    { id: 0, name: 'Fazer cafê', done: false },
    { id: 1, name: 'Acordar', done: false },
    { id: 3, name: 'Fazer um curriculo', done: false },
  ]);


  return (
    <C.Container>
      <C.Area>
        <C.Header>My TODO List</C.Header>


        {list.map((item, index) => (
            <div>...</div>
        ))}

      </C.Area>
    </C.Container>
  );
}

